"       J Nucl Med Technol",
"      </i>",
"      , 2009, 37(3):191-5. Available at file://interactive.snm.org/docs/Brain_SPECT_Guideline_2003.pdf. Last accessed August 26, 2011.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?36/0/36866/abstract-text/19692453/pubmed\" id=\"19692453\" target=\"_blank\">",
