"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Marshall DS, Newberry NR, and Ryan PJ, \"Measurement of the Secretion of Technetium-99m Hexamethylpropylene Amine Oxime Into Breast Milk,\"",
"      <i>",
"       Eur J Nucl Med",
"      </i>",
"      , 1996, 23(12):1634-5.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?36/0/36866/abstract-text/8929318/pubmed\" id=\"8929318\" target=\"_blank\">",
"        8929318",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Palestro CJ, Brown ML, Forstrom LA, et al, &ldquo;Society of Nuclear Medicine Procedure Guideline for",
"      <sup>",
"       99m",
