"      Tc-Exametazime (HMPAO)-Labeled Leukocyte Scintigraphy for Suspected Infection/Inflammation,&rdquo; 2004. Available at file://interactive.snm.org/docs/HMPAO_v3.pdf. Last accessed August 26, 2011.",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Stabin MG and Breitz HB, \"Breast Milk Excretion of Radiopharmaceuticals: Mechanisms, Findings, and Radiation Dosimetry,\"",
"      <i>",
"       J Nucl Med",
"      </i>",
"      , 2000, 41(5):863-73.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?36/0/36866/abstract-text/10809203/pubmed\" id=\"10809203\" target=\"_blank\">",
