var title_f36_0_36870="Endotracheal intubation Shikani optical stylet";
var content_f36_0_36870=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F67775&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F67775&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 490px\">",
"   <div class=\"ttl\">",
"    Endotracheal intubation with the Shikiani optical stylet",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 470px; height: 609px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) The patient's mandible and tongue are retracted anteriorly with the nondominant hand. Using the dominant hand, the operator inserts the scope and endotracheal tube into the center of the patient's mouth and advances them over the tongue.",
"    <br>",
"     (B) While looking through the eyepiece, the operator advances the stylet and endotracheal tube beneath the epiglottis and into the glottic opening.",
"     <br>",
"      (C) The endotracheal tube is released from the adjustable stop and passed over the stylet into the proper position.",
"      <br>",
"       (D) The stylet is carefully removed, with care taken not to dislodge the endotracheal tube.",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"        Reproduced with permission from: King BR, Hagberg CA. Management of the difficult airway. In: Textbook of Pediatric Emergency Procedures, 2nd edition, King C, Henretig FM (Eds). Lippincott Williams &amp; Wilkins, Philadelphia 2008. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"       </div>",
"       <div class=\"contractual\">",
"        <br/>",
"        <a href=\"file://www.lww.com\">",
"         file://www.lww.com",
"        </a>",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
