"   <p class=\"headingAnchor\" id=\"PATIENT_INFORMATION\">",
"    <span class=\"h1\">",
"     INFORMATION FOR PATIENTS",
"    </span>",
"    &nbsp;&mdash;&nbsp;UpToDate offers two types of patient education materials, &ldquo;The Basics&rdquo; and &ldquo;Beyond the Basics.&rdquo; The Basics patient education pieces are written in plain language, at the 5",
"    <sup>",
"     th",
"    </sup>",
"    to 6",
"    <sup>",
"     th",
"    </sup>",
"    grade reading level, and they answer the four or five key questions a patient might have about a given condition. These articles are best for patients who want a general overview and who prefer short, easy-to-read materials. Beyond the Basics patient education pieces are longer, more sophisticated, and more detailed. These articles are written at the 10",
"    <sup>",
"     th",
"    </sup>",
"    to 12",
"    <sup>",
"     th",
"    </sup>",
"    grade reading level and are best for patients who want in-depth information and are comfortable with some medical jargon.",
"   </p>",
"   <p>",
"    Here are the patient education articles that are relevant to this topic. We encourage you to print or e-mail these topics to your patients. (You can also locate patient education articles on a variety of subjects by searching on &ldquo;patient info&rdquo; and the keyword(s) of interest.)",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Basics topics (see",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?37/38/38497?source=see_link\">",
"       \"Patient information: Sudden infant death syndrome (SIDS) (The Basics)\"",
"      </a>",
"      )",
"     </li>",
"     <li>",
"      Beyond the Basics topics (see",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?7/40/7811?source=see_link\">",
"       \"Patient information: Sudden infant death syndrome (SIDS) (Beyond the Basics)\"",
"      </a>",
"      )",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H13236842\">",
"    <span class=\"h1\">",
"     SUMMARY AND RECOMMENDATIONS",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Sudden unexpected infant death (SUID), or sudden unexpected death in infancy (SUDI), describes all unexpected infant deaths, and includes deaths caused by sudden infant death syndrome (SIDS). SIDS is defined as the sudden death of an infant less than one year of age, which remains unexplained after a thorough case investigation including performance of a complete autopsy, examination of the death scene, and review of the clinical history. It is the leading cause of mortality in infants between one month and one year of age in the United States. (See",
"      <a class=\"local\" href=\"#H24299863\">",
"       'Definition'",
"      </a>",
"      above.) &nbsp;",
"     </li>",
"     <li>",
"      The appropriate professional response to the death of any infant is compassionate, empathic, supportive, and nonaccusatory. At the same time, it is essential to discover the cause of death, if possible. (See",
"      <a class=\"local\" href=\"#H24300022\">",
"       'Family communication and support'",
"      </a>",
"      above and",
"      <a class=\"local\" href=\"#H6183988\">",
"       'Case investigation'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Development and implementation of protocols for evaluation of the death scene and autopsy have led to more standardized approaches to unexpected infant deaths and increasing use of the diagnosis of accidental asphyxia. Nonetheless, the application of the guidelines and diagnosis assigned to a case remains inconsistent. (See",
"      <a class=\"local\" href=\"#H24300344\">",
"       'Death scene investigation'",
"      </a>",
"      above and",
"      <a class=\"local\" href=\"#H24300351\">",
"       'Autopsy'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      A number of risk factors for SIDS have been identified (",
"      <a class=\"graphic graphic_table graphicRef75379 \" href=\"mobipreview.htm?27/60/28620\">",
"       table 2",
"      </a>",
"      ). These include exposure to cigarette smoke, maternal age &lt;20 years, prematurity, prone sleeping position, bed-sharing, soft bedding, and overheating. (See",
"      <a class=\"local\" href=\"#H6183419\">",
"       'Clinical and family history'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      The differential diagnosis of SUID includes fatal child abuse and inborn errors of metabolism, as well as a number of less common disorders (",
"      <a class=\"graphic graphic_table graphicRef79550 \" href=\"mobipreview.htm?3/47/3837\">",
"       table 3",
"      </a>",
"      ). Identification of these causes may prevent morbidity and mortality in siblings of the index case. (See",
"      <a class=\"local\" href=\"#H13236291\">",
"       'Differential diagnosis'",
"      </a>",
"      above.) &nbsp;",
"     </li>",
"     <li>",
"      Features that increase the possibility of fatal child abuse include (see",
"      <a class=\"local\" href=\"#H13236298\">",
"       'Fatal child abuse'",
"      </a>",
"      above):",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"hyphen-block\">",
"     <li>",
"      Previous recurrent cyanosis, apnea, or an apparent life-threatening event (ALTE) while in the care of the same person",
"     </li>",
"     <li>",
"      Age at death older than six months",
"     </li>",
"     <li>",
"      History of previous SIDS or unexpected death of a sibling (although most cases of recurrent SIDS in a family are not due to child abuse)",
"     </li>",
"     <li>",
"      Previous death of infants under the care of the same unrelated person",
"     </li>",
"     <li>",
"      Simultaneous or near-simultaneous death of twins",
"     </li>",
"     <li>",
"      Evidence of previous pulmonary hemorrhage (such as marked siderophages in the lung)",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Features that increase the probability of a metabolic disease include (see",
"      <a class=\"local\" href=\"#H13236312\">",
"       'Metabolic disease'",
"      </a>",
"      above):",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"hyphen-block\">",
"     <li>",
"      History of previous SIDS or unexpected death in a sibling (especially if the death occurred in the first weeks or after two years of life)",
"     </li>",
"     <li>",
"      Family history of a sibling or cousin with an ALTE, Reye's syndrome, or myopathy",
"     </li>",
"     <li>",
"      Symptoms or signs prior to death, such as neonatal hypoglycemia, an ALTE, muscular hypotonia, vomiting, failure to thrive, hyperventilation, severe infections, or elevated aminotransferase levels",
"     </li>",
"    </ul>",
"   </p>",
