var title_f36_0_36875="Conservative surgeries approach";
var content_f36_0_36875=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F83099&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F83099&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Conservative surgeries approach: hypopharynx cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Procedure",
"       </td>",
"       <td class=\"subtitle1\">",
"        Description",
"       </td>",
"       <td class=\"subtitle1\">",
"        Patient selection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Suprahyoid pharyngotomy",
"       </td>",
"       <td>",
"        A horizontal incision over the hyoid with anterior to posterior dissection exposing the posterior hypopharyngeal wall",
"       </td>",
"       <td>",
"        Tumors localized to the posterior hypopharyngeal wall",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Partial laryngopharyngectomy or extended supraglottic partial laryngectomy",
"       </td>",
"       <td>",
"        Approaches the tumor from the contralateral side through the aryepiglottic fold anterior to the arytenoids and then through the ventricle",
"       </td>",
"       <td>",
"        Posterior pharyngeal wall tumors; pyriform sinus tumors that are without vocal cord abnormality, extension to the apex of the pyriform sinus, or thyroid cartilage invasion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Supracricoid hemilaryngopharyngectomy",
"       </td>",
"       <td>",
"        Removes the entire supraglottis, the false and true vocal cords, and the thyroid cartilage, including the paraglottic and preepiglottic spaces",
"       </td>",
"       <td>",
"        Pyriform sinus tumors without invasion of the apex, the postcricoid region, or posterior pharyngeal wall, and without fixation of true vocal cords",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Minimally invasive procedures",
"       </td>",
"       <td>",
"        Transoral approach with CO",
"        <sub>",
"         2",
"        </sub>",
"        laser resection",
"       </td>",
"       <td>",
"        Tumors with shallow invasion of the subepithelium; with at least one mobile arytenoid cartilage",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Dr. Suisui Song, The University of Chicago Medical Center.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
